import React from 'react';
import AddDeliveryForm from './AddDeliveryForm';
import UpdateDeliveryForm from './UpdateDeliveryForm';

const Sidebar = ({ refreshDeliveries, setDeliveries }) => {
  return (
    <div className="sidebar">
      <h2>Add New Delivery</h2>
      <AddDeliveryForm refreshDeliveries={refreshDeliveries} setDeliveries={setDeliveries} />

      <h2>Update Delivery</h2>
      <UpdateDeliveryForm refreshDeliveries={refreshDeliveries} setDeliveries={setDeliveries} />
    </div>
  );
};

export default Sidebar;
